import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import ClientePesquisa from './pages/ClientePesquisa';
import InformacoesGeraisPage from './pages/InformacoesGeraisPage';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/pesquisa">Pesquisar Cliente</Link>
            </li>
            <li>
              <Link to="/informacoes">Informações Gerais</Link>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route path="/pesquisa">
            <ClientePesquisa />
          </Route>
          <Route path="/informacoes">
            <InformacoesGeraisPage />
          </Route>
          <Route path="/">
            <h1>Bem-vindo ao Sistema de Gerenciamento de Clientes</h1>
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
